original_question:
Dua belas kotak berukuran 1 kali 1 membentuk sebuah persegi panjang, seperti yang ditunjukkan. Berapakah total luas daerah yang diarsir? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Bagian yang diisi
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// grid
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

//diagonals
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

