Roda yang ditunjukkan diputar dua kali, sehingga angka-angka yang ditunjukkan oleh penunjuk ditentukan secara acak (dengan setiap angka pada roda memiliki kemungkinan yang sama). Dua angka yang ditentukan dengan cara ini dicatat. Angka pertama dibagi dengan 4, menentukan salah satu sisa 1,2,3 yang menandai kolom papan catur yang ditunjukkan. Angka kedua dibagi dengan 5, menentukan salah satu sisa 1,2,3,4 yang menandai baris papan catur. Akhirnya, sebuah bidak ditempatkan pada kotak di mana kolom dan baris ini bertemu. Berapakah probabilitas bahwa bidak ditempatkan pada kotak berbayang dari papan catur?

